%Recalculating to use speed for single cell calcs
%Histogram the mean speed and attempts to fit to a double gaussian,
%assuming smaller curve is nonmigratory cells
%Sets border between migratory and nonmigratory cells at 2 SDs above mean
%of smaller curve
h= histogram(Speedmeans,'BinWidth',1,'Normalization','pdf','DisplayStyle','stairs'); %[output:311e81ea]
counts = h.Values;
binEdges = h.BinEdges;
clf
binCenters = binEdges(1:end-1) + diff(binEdges)/2;
[fite,gof] = fit(binCenters',counts','gauss2') %[output:2d10aa92] %[output:79a8b779]
hold on
plot(fite,binCenters,counts)
xline(fite.b1+2*fite.c1)
hold off
clf
Speedborder = fite.b1+2*fite.c1 %[output:1c5db26e]
spestate=[];
spebin = (Speedmeans>=Speedborder)+1;
transition = [0.96 0.04; 0.01 0.99];
emission =[ 0.84 0.16; 0.33 0.69];
[trainedR,trainedE]=hmmtrain(spebin,transition,emission) %[output:04018d77] %[output:891fd0fd]
for j=1:25
spestate(j,:) = hmmviterbi(spebin(j,:),trainedR,trainedE);
end
spE = trainedE;
spR= trainedR;
%%
%Make binarized single cell tracks 
xsort =(sortedtrack(:,:,37)>=xborder)+1;
psort =(sortedtrack(:,:,4)>=polborder)+1;
ssort =(sortedtrack(:,:,73)>=delborder)+1;
%%
%Use previous markov models parameters to predict each trace
SCXstate=[]; SCPstate=[]; SCSstate=[];
for i=1:length(xsort)
    SCXstate(i,:) = hmmviterbi(xsort(i,:),xR,xE);
    SCPstate(i,:) = hmmviterbi(psort(i,:),pR,pE);
    SCSstate(i,:) = hmmviterbi(ssort(i,:),sR,sE);
end
%%
%Stat checks 
Xbins = logical(SCXstate-1);
pBins = logical(SCPstate-1);
sbins = logical(SCSstate-1);

%Sanity check- confirming that we are actually enriching
polsampl = sortedtrack(:,:,4);
hold on %[output:245d8026]
histogram(polsampl(Xbins),'DisplayStyle','stairs') %[output:245d8026]
histogram(polsampl(~Xbins),'DisplayStyle','stairs') %[output:245d8026]
legend('Polarized','Unpolarized') %[output:245d8026]
hold off %[output:245d8026]
clf
%%
%Filtering out tracks that never polarize or never start migrating
prerealtracksx=max(SCXstate,[],2)==2;
prerealtracksp=max(SCPstate,[],2)==2;
realstrackssp = max(SCSstate,[],2)==2;
realtracksx = logical(prerealtracksx.*realstrackssp);
realtracksp = logical(prerealtracksp.*realstrackssp);
[~,rawXmagInitiationIndexes]=max(SCXstate(:,1:end),[],2);
[~,rawPolInitiationIndexes]=max(SCPstate(:,1:end),[],2);
[~,rawSpeedinitationIndexes]=max(SCSstate(:,1:end),[],2);
SCXstate=SCXstate(realtracksx,:);
SCPstate=SCPstate(realtracksp,:);
[~,XmagInitiationIndexes]=max(SCXstate(:,1:end),[],2);
[~,PolInitiationIndexes]=max(SCPstate(:,1:end),[],2);
[~,SpeedinitationIndexes]=max(SCSstate(:,1:end),[],2);
%%
%Find where cells were at start of migration
StartingX = [];
for i=1:length(SpeedinitationIndexes)
    StartingX(i) = [sortedtrack(i,(SpeedinitationIndexes(i)),zval)];
end
%%
%Calculate delay between migration and polarization for each cell
PolarityDelay = PolInitiationIndexes-SpeedinitationIndexes(realtracksp);
XMagDelay = XmagInitiationIndexes-SpeedinitationIndexes(realtracksx);
%%
%Filter out tracks that are erroneously called as polarized at start of movie
FilterNumber =5;
SpeedinitationIndexesFilter = SpeedinitationIndexes(realtracksp);
StartingXFilter = StartingX(realtracksp)';
StartingXFilter=StartingXFilter(PolInitiationIndexes>FilterNumber);
BinIdentityFilter=[];
PolarityDelay = PolarityDelay(PolInitiationIndexes>FilterNumber);
[TissueOrder,OrderIndex] = sortrows(StartingXFilter);
PolDelayOrdered = PolarityDelay(OrderIndex);
%%
% Create bins boundaries
Numberofrows =25;
bounds=zeros(1,Numberofrows);
    for j=0:Numberofrows
        bounds(1,j+1)=quantile(StartingXFilter,j/Numberofrows);
    end
%Sanity Check Plot
scatter([1:26],bounds) %[output:4ee35831]
xlabel('bin') %[output:4ee35831]
ylabel('X-position') %[output:4ee35831]
hold off %[output:4ee35831]
clf %[output:93cbb6c7]

% Assigns each cell a bin based on where it was when it started migrating
BinIndentityFilter= zeros(length(PolarityDelay),1);
for i=1:25
    BinIndentityFilter(:,1)= BinIndentityFilter(:,1)+(StartingXFilter(:) >= bounds(1,i) & StartingXFilter(:)< bounds(1,i+1))*i;
end
h=histogram(BinIndentityFilter); %[output:93cbb6c7]
xlabel('bin') %[output:93cbb6c7]
ylabel('Number of cells in bin') %[output:93cbb6c7]
Cellsperbin = ceil(mean(h.Values(2:end)))+2;
%%
%Calculate stats for each bin
PolarityDelByBin = zeros(Cellsperbin,Numberofrows);
StartXbyBin = zeros(Cellsperbin,Numberofrows);
for i=1:25
    PolarityDelByBin(:,i) = paddata(PolDelayOrdered(BinIndentityFilter==i),Cellsperbin,'FillValue',NaN);
    StartXbyBin(:,i) = paddata(TissueOrder(BinIndentityFilter==i),Cellsperbin,'FillValue',NaN);
end
PolarityDelByBin=flip(PolarityDelByBin);
StartXbyBin=flip(StartXbyBin);

abba = PolarityDelByBin*0.5 ; %Hours Conversion
Meandelay = mean(abba(4:18),"all",'omitmissing') %Mean delay accross bins %[output:040fc79b]
%%
%Final plots - box with quantiles
clf %[output:8d4c1ac7]
subplot(1,5,1:4) %[output:8d4c1ac7]
hold on %[output:8d4c1ac7]
yline(0,'color',[0.5,0.5,0.5],'LineStyle',':','LineWidth',0.25); %[output:8d4c1ac7]
bx = boxplot(abba,'OutlierSize',2,'Symbol',' '); %[output:8d4c1ac7]
bx1 = findobj(gca,'Tag','boxplot');
set(bx1.Children,'LineWidth',1) %[output:8d4c1ac7]
median(abba,'all','omitmissing');
upperWhiskers = findobj(bx, 'Tag', 'Upper Whisker');
lowerWhiskers = findobj(bx, 'Tag', 'Lower Whisker');
upperline= findobj(bx, 'Tag', 'Upper Adjacent Value');
lowerline = findobj(bx, 'Tag', 'Lower Adjacent Value');
set(upperWhiskers, 'LineStyle', '-'); % '-' for solid line %[output:8d4c1ac7]
set(lowerWhiskers, 'LineStyle', '-'); %[output:8d4c1ac7]
for i =1:size(abba,2)
    set(lowerWhiskers(i),'YData',[prctile(abba(:,i),10),prctile(abba(:,i),25)]) %[output:8d4c1ac7]
    set(lowerline(i), 'YData', [prctile(abba(:,i), 10),[prctile(abba(:,i), 10)]]);

    set(upperWhiskers(i),'YData',[prctile(abba(:,i),75),prctile(abba(:,i),90)])
    set(upperline(i), 'YData', [prctile(abba(:,i), 90),prctile(abba(:,i), 90)]);
end
set(lowerWhiskers, 'Color', [0.5,0.5,0.5]); %[output:8d4c1ac7]
set(upperWhiskers, 'Color', [0.5,0.5,0.5]); %[output:8d4c1ac7]
axis([3,19,-2.5,17.5]) %[output:8d4c1ac7]
ylabel('Polarity delay (hrs)') %[output:8d4c1ac7]
box on %[output:8d4c1ac7]
hold off %[output:8d4c1ac7]

%Final plot - histogram
subplot(1,5,5) %[output:8d4c1ac7]
h= histogram(abba(:,4:19),'BinWidth',0.5,'DisplayStyle','bar','Normalization','percentage','FaceColor','none'); %[output:8d4c1ac7]
h.Orientation = 'horizontal'; %[output:8d4c1ac7]
h.LineWidth =0.75; %[output:8d4c1ac7]
ax = gca;
yticklabels([]) %[output:8d4c1ac7]
axis([0,30,-2.5,17.5]) %[output:8d4c1ac7]
clf
anova(abba(:,[4:18])) %[output:91bd13a8]

